import { BrowserRouter as Router } from 'react-router-dom';

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }

  render() {
    return (
      // <!--Section: Contact v.2-->
      <section class="mb-4" style={{ marginTop: '70px' }}>

        {/* <!--Section heading--> */}
        <h2 class="h1-responsive text-center my-4">Order management</h2>
        <div class="row">

          {/* <!--Grid column--> */}
          <div class="col-md-12 mb-md-0 mb-5" style={{ border: '1px solid red' }}>


            <div class="text-center text-md-left">
              <a class="btn btn-primary" onclick="document.getElementById('contact-form').submit();">Send</a>
            </div>
            <div class="status">aaa</div>
          </div>
        </div>

      </section>
    );
  }
}

export default Home;
